import React from "react";
import { createBottomTabNavigator } from "@react-navigation/bottom-tabs";
import { createStackNavigator } from "@react-navigation/stack"; // 1. IMPORT STACK
import { View, Text } from "react-native";
import { MaterialIcons } from '@expo/vector-icons';

// --- 2. IMPORT ALL SCREENS ---
import HomeScreen from "../screens/HomeScreen";
import PlanTripScreen from "../screens/PlanTripScreen";
import DonationScreen from "../screens/DonationScreen";
import ProfileScreen from "../screens/ProfileScreen";
import TempleDetailScreen from "../screens/TempleDetailScreen"; // <-- IMPORT DETAIL SCREEN

const Tab = createBottomTabNavigator();
const Stack = createStackNavigator(); // <-- 3. INITIALIZE STACK

const TabIcon = ({ name, color, size }) => (
  <MaterialIcons name={name} size={size} color={color} />
);

// --- 4. COMMON HEADER STYLE ---
const stackScreenOptions = {
  headerStyle: {
    backgroundColor: "#FF6B35",
  },
  headerTintColor: "#fff",
  headerTitleStyle: {
    fontWeight: "bold",
  },
};

// --- 5. CREATE STACKS FOR EACH TAB ---
// This ensures headers are consistent and navigation works as expected.

function HomeStack() {
  return (
    <Stack.Navigator screenOptions={stackScreenOptions}>
      <Stack.Screen
        name="HomeStack"
        component={HomeScreen}
        options={{ title: "BhaktiBhraman" }}
      />
      <Stack.Screen
        name="TempleDetail" // This is what you navigate to
        component={TempleDetailScreen}
        options={{ title: "Temple Details" }}
      />
    </Stack.Navigator>
  );
}

function PlanStack() {
  return (
    <Stack.Navigator screenOptions={stackScreenOptions}>
      <Stack.Screen
        name="PlanTrip"
        component={PlanTripScreen}
        options={{ title: "Plan Your Trip" }}
      />
    </Stack.Navigator>
  );
}

function DonationStack() {
  return (
    <Stack.Navigator screenOptions={stackScreenOptions}>
      <Stack.Screen
        name="DonateStack"
        component={DonationScreen}
        options={{ title: "Temple Donation" }}
      />
    </Stack.Navigator>
  );
}

function ProfileStack() {
  return (
    <Stack.Navigator screenOptions={stackScreenOptions}>
      <Stack.Screen
        name="ProfileStack"
        component={ProfileScreen}
        options={{ title: "Profile" }}
      />
    </Stack.Navigator>
  );
}

// --- 6. YOUR MAIN TAB NAVIGATOR ---
export default function TabNavigator() {
  return (
    <Tab.Navigator
      screenOptions={{
        // --- 7. HIDE THE TAB'S DEFAULT HEADER ---
        // Each Stack will now provide its own header.
        headerShown: false,
        tabBarActiveTintColor: "#FF6B35",
        tabBarInactiveTintColor: "#666",
        tabBarStyle: {
          backgroundColor: "#fff",
          borderTopWidth: 1,
          borderTopColor: "#e0e0e0",
          height: 60,
          paddingBottom: 8,
          paddingTop: 8,
        },
        tabBarLabelStyle: {
          fontSize: 12,
          fontWeight: "500",
        },
      }}
    >
      <Tab.Screen
        name="Home"
        component={HomeStack} // <-- Use the HomeStack
        options={{
          tabBarIcon: ({ color, size }) => (
            <TabIcon name="home" color={color} size={size} />
          ),
        }}
      />
      <Tab.Screen
        name="Plan"
        component={PlanStack} // <-- Use the PlanStack
        options={{
          tabBarIcon: ({ color, size }) => (
            <TabIcon name="flight" color={color} size={size} />
          ),
        }}
      />
      {/* NO BLANK LINE HERE */}
      <Tab.Screen
        name="Donate"
        component={DonationStack} // <-- Use the DonationStack
        options={{
          tabBarIcon: ({ color, size }) => (
            <View style={{ position: "relative" }}>
              <TabIcon name="volunteer-activism" color={color} size={size} />
              {color === "#FF6B35" && (
                <View
                  style={{
                    position: "absolute",
                    top: -2,
                    right: -2,
                    backgroundColor: "#FF6B35",
                    borderRadius: 8,
                    width: 16,
                    height: 16,
                    justifyContent: "center",
                    alignItems: "center",
                  }}
                >
              <Text
                    style={{ color: "#fff", fontSize: 10, fontWeight: "bold" }}
                  >
                    6
                  </Text>
                </View>
              )}
            </View>
          ),
        }}
      />
      <Tab.Screen
        name="Profile"
        component={ProfileStack} // <-- Use the ProfileStack
Note         options={{
          tabBarIcon: ({ color, size }) => (
            <TabIcon name="person" color={color} size={size} />
          ),
        }}
      />
    </Tab.Navigator>
  );
}
